import styles from "../css/App.module.css";

function BtnOfMenu({ cateName, handleCate }) {
  return (
    <div className={styles.menuCateBtnWrap}>
      <button onClick={() => handleCate}>{cateName}</button>
    </div>
  );
}

export default BtnOfMenu;
